import React, { useState } from "react";

function TableCom({ value }) {
  const [TableData] = useState([value]);
  
  return TableData.map((value, index) => {
    console.log(index);
    return (
      <tr key={index}>
        <td>{value.id}</td>
        <td>{value.name}</td>
        <td>{value.email}</td>
        <td>{value.address.street}</td>
        <td>{value.phone}</td>
      </tr>
    );
  });
}

export default TableCom;
